            class ParallelEventContainer {
              constructor(events) {
                this.events = events;
                this.status = events.map((e) => false);
                this.base_elapsed = undefined;
              }

              process_event(elapsed, finish_requested) {
                if (this.base_elapsed === undefined)
                  this.base_elapsed = elapsed;

                const event_elapsed = elapsed - this.base_elapsed;

                this.events.forEach((event, idx) => {
                  if (!this.status[idx])
                    this.status[idx] = event.process_event(event_elapsed, finish_requested);
                });

                return this.status.reduce((prev, curr) => prev && curr);
              }

              undo() {
                this.status = this.events.map(() => false);
                this.base_elapsed = undefined;
                this.events.forEach(e => e.undo());
              }
            }

            class SequentialEventContainer {
              constructor(events) {
                this.events = events;
                this.base_elapsed = undefined;
                this.idx = 0;
              }

              process_event(elapsed, finish_requested) {
                if (this.base_elapsed === undefined)
                  this.base_elapsed = elapsed;

                if (this.idx < this.events.length) {
                  const event_elapsed = elapsed - this.base_elapsed;
                  const finished = this.events[this.idx].process_event(event_elapsed, finish_requested);
                  if (finished) {
                    this.base_elapsed = undefined;
                    this.idx++
                  }
                }

                if (finish_requested) {
                  while(this.idx < this.events.length) {
                    this.events[this.idx].process_event(0, finish_requested);
                    this.idx++
                  }
                }

                return this.idx >= this.events.length
              }

              undo() {
                this.base_elapsed = undefined;
                this.idx = 0;
                // forEach can't iterate backwards, so use reduceRight.
                this.events.reduceRight((_, e) => e.undo(), null);
              }
            }

            class PathEvent {
              constructor(path) {
                this.path = path;
                this.length = path.getTotalLength();
                this.total_time = this.length / 0.8;
              }

              // Draws paths on the screen based on time elapsed and draw speed.
              // Returns true if the path has been drawn entirely.
              process_event(elapsed, finish_requested) {
                const percentage = elapsed/this.total_time;
                let progress = Math.min(1, percentage);
                if (finish_requested)
                  progress = 1
                this.path.style.strokeDashoffset = Math.floor(this.length * (1 - progress));
                return progress === 1;
              }

              // Clears the path from screen
              clear_from_screen() {
                this.path.style.strokeDasharray = this.length + " " + this.length;
                this.path.style.strokeDashoffset = this.length;
              }

              undo() {
                this.clear_from_screen();
              }
            }

            class CameraEvent {
              constructor(old_cam, new_cam, duration, root) {
                this.old_cam = old_cam;
                this.new_cam = new_cam;
                this.total_delta = new_cam.map((n, idx) => n - old_cam[idx]);
                this.duration = duration;
                this.root = root;
              }

              static smoothing(percentage) {
                // doubleExponentialSigmoid
                const param = 0.727;
                if (percentage <= 0.5)
                  return Math.pow(2. * percentage, 1./param) / 2.;
                return 1 - Math.pow(2. * (1 - percentage), 1./param) / 2.;;
              }

              progress(elapsed, finish_requested) {
                if (this.duration === 0 || finish_requested)
                  return 1;
                const percentage = Math.min(1, elapsed / this.duration);
                return CameraEvent.smoothing(percentage);
              }

              process_event(elapsed, finish_requested) {
                const progress = this.progress(elapsed, finish_requested)
                const cam = this.old_cam.map((n, idx) => n + progress * this.total_delta[idx])
                this.root.setAttribute("viewBox", cam.join(" "));
                return progress === 1;
              }

              undo() {
                if (typeof this.old_cam !== "undefined")
                  this.root.setAttribute("viewBox", this.old_cam.join(" "));
              }
            }

            class FadeEvent {
              constructor(obj, total_time) {
                this.obj = obj;
                this.total_time = total_time;
              }

              // Draws objs on the screen based on time elapsed and draw speed.
              // Returns true if the obj has been drawn entirely.
              process_event(elapsed, finish_requested) {
                const percentage = elapsed/this.total_time;
                let progress = Math.min(1, percentage);
                if (finish_requested)
                  progress = 1
                this.obj.style.opacity = progress;
                return progress === 1;
              }

              // Clears the obj from screen
              clear_from_screen() {
                this.obj.style.opacity = 0;
              }

              undo() {
                this.clear_from_screen();
              }
